package a01_diexp.z10_vo;


public class Pen {
	private String comp;
	private int price;
	public Pen() {
		// TODO Auto-generated constructor stub
	}
	public Pen(String comp, int price) {
		this.comp = comp;
		this.price = price;
	}
	public String getComp() {
		return comp;
	}
	public void setComp(String comp) {
		this.comp = comp;
	}
	public int getPrice() {
		return price;
	}
	public void setPrice(int price) {
		this.price = price;
	}
	
}
